import React from 'react';

export const PageCenter = (props) => {
  return (
    <div style={styles.backgroundStyle}>
      {props.children}
    </div>
  );
};

const styles = {
  backgroundStyle: {
    background: 'black',
    height: '100%',
    width: '100%-400px',
    minWidth: 235,
    position: 'absolute',
    left: 220,
    right: "100%",
    top: 0,
    display: 'block',
    overflow: 'hidden',
    zIndex: 9,
  },
};
